// Components/NavBar.js
import { Link } from 'react-router-dom';

const Navbar = () => {
 return (
 <nav>
       <ul>
          <li>
             <Link to="/">Home</Link>
          </li>
          <li>
             <Link to="/Char">Chat</Link>
          </li>
          <li>
             <Link to="/Music">Music</Link>
          </li>
       </ul>
 </nav>
 );
};

export default Navbar;
